            //         <div classsName="form-group">
            //             <label htmlFor="email" name="email">Email</label>
            //             <input type="email" name="email" id="email" placeholder="Email"/>
            //         </div>
    
            //         <div classsName="form-group">
            //             <label htmlFor="contact" name="contact">Contact</label>
            //             <input type="number" name="contact" id="contact" placeholder="Contact" />
            //         </div>
    
            //         <div classsName="form-group">
            //             <label htmlFor="password" name="password">Password</label>
            //             <input type="password" name="password" id="password"  />
            //         </div>
                    
            //         <div classsName="form-group">
            //             <label htmlFor="cnf_password" name="cnf_password">Confirm Password</label>
            //             <input type="password" name="cnf_password" id="cnf_password"/>
            //         </div>
    
            //         <button className="btn btn-success">Register</button>
    
            //     </form>
            // </div>
        )
    }
}

